pageContext.rootQuery:
query MovieById($uid: String!) {
  prismic {
    allMovies(uid: $uid) {
      edges {
        node {
          _meta {
            id
            lang
            lastPublicationDate
          }

          title

          seo_title
          seo_description
          seo_keywords

          topbar {
            ...TopbarFragment
          }
          footer {
            ...FooterFragment
          }

          body {
            ...MoviePageMovieSliderFragment
            ...MovieHeaderFragment
            ...MoviePageContentBlockFragment
          }
        }
      }
    }
  }
}
